    id: 5,
    date: 'Aug 18',
    firstName: 'fooooo',
    lastName: 'baaaaz'}
    ]

function App() {
  return (
    <div className="App">
      <header >
      </header>
      <div className="App-body">
        <Title />
        <Content 
          birthdayList= {birthdayList}
        />
      </div>
    </div>
  );
}

export default App;
